import logo from './logo.svg';
import './App.css';
import LoginButton from './Components/LoginButton';
import LogoutButton from './Components/LogoutButton';
import Profile from './Components/Profile';

function App() {
  return (
    <div className="App">
      <div id="app-wrapper">
        <h1>Welcome to our cruise0! Start your unforgettable journey by logging in and unlocking exclusive deals and breathtaking destinations.</h1>
        <div id="login-wrapper">
          <LoginButton />
          <LogoutButton />
        </div>
        <div id="profile-wrapper">
          <Profile />
        </div>
      </div>
    </div>
  );
}

export default App;
